#calculate the mean of rbx in a 2D histgram according to the map above (only for nonzero bins)
class RBXMean(BaseMetric):
    def __init__(self,  name, depth):
        self.__name = name
        self.__map = hcal_map
        self.__dep = depth
    def calculate(self, histo):
        result = (0,0)
        hsum=0
        hentry=0
        if self.__name in self.__map:
            eta_phi_dep = self.__map[self.__name]
            for eta, phi, dep in eta_phi_dep:
                if (dep in self.__dep) and eta>0 and eta<85 and phi>0 and phi<73 :
                    if dep == self.__dep[0] and histo.GetBinContent(eta, phi)!=0:
                        hentry+=1
                        hsum+=histo.GetBinContent(eta, phi)
                    elif dep == self.__dep[1] and self._histo1.GetBinContent(eta, phi)!=0:
                        hentry+=1
                        hsum+=histo.GetBinContent(eta, phi)
                    elif dep == self.__dep[2] and self._histo2.GetBinContent(eta, phi)!=0:
                        hentry+=1
                        hsum+=histo.GetBinContent(eta, phi)
        if hentry != 0:
            hsum /= hentry
            result = (hsum, 0)
        return result


#count the number of nonzero bins 
class RBXCountNonZeroChan(BaseMetric):
    def __init__(self,  name, depth):
        self.__name = name
        self.__map = hcal_map
        self.__dep = depth
    def calculate(self, histo):
        hentry=0
        if self.__name in self.__map:
            eta_phi_dep = self.__map[self.__name]
            for eta, phi, dep in eta_phi_dep:
                if (dep in self.__dep) and eta>0 and eta<85 and phi>0 and phi<73 :
                    if dep == self.__dep[0] and histo.GetBinContent(eta, phi)!=0:
                            hentry+=1
                    elif dep == self.__dep[1] and self._histo1.GetBinContent(eta, phi)!=0:
                            hentry+=1
                    elif dep == self.__dep[2] and self._histo2.GetBinContent(eta, phi)!=0:
                            hentry+=1
        return (hentry, 0)
    